import React from "react";
import { Box, HStack, Image } from "@chakra-ui/react";
import logo from "../images/Asset 16@4x.png"

const links = [
    {
      name: "Home",
      url: "/#contact-me",
      anchor: "contactme",
    },
    {
      name: "About",
      url: "/#contact-me",
      anchor: "contactme",
    },
    {
      name: "Menu",
      url: "/#contact-me",
      anchor: "contactme",
    },
    {
      name: "Reservations",
      url: "/#contact-me",
      anchor: "contactme",
    },
    {
      name: "Order online",
      url: "/#contact-me",
      anchor: "contactme",
    },
    {
      name: "Login",
      url: "/#contact-me",
      anchor: "contactme",
    },
  ];

const Header = () => {
    return (
        <Box
            position="fixed"
            top={0}
            left={0}
            right={0}
            translateY={0}
            transitionProperty="transform"
            transitionDuration=".3s"
            transitionTimingFunction="ease-in-out"
            backgroundColor="whiteAlpha.50"
        >
            <Box 
            color="gray.500" 
            margin="0 auto"
            >
                <HStack
                    px={16}
                    py={4}
                    justifyContent="space-between"
                    alignItems="center"
                >
                    <nav>
                        <HStack spacing={8}>
                            <Image src={logo} alt="Logo" height={"60px"} />
                        </HStack>
                    </nav>
                    <nav>
                        <HStack spacing={8}>
                            {links.map(link => <a key={link.anchor} href={link.url} onMouseOver={(e)=>e.color="white"}> {link.name}</a>)}
                        </HStack>
                    </nav>
                </HStack>
            </Box>
        </Box>
    );
};

export default Header;
